import React , { useState } from "react"
import TeamChars from "./TeamChars";

function Team( { teamChars , setTeamChars} ) {

    const assistArray = ["", "", ""]


    //I know I could break this apart but it works like this and i might do it later
    //why cant we make verticle tables? i have to break down each of my objects so much
    //for them to work in this format
    const charNames = teamChars.map((char) => {
        const thing = char.strengths.text.map((str) => { return <>{str}<br></br></>})
        return (
            <td key={char.name} title={thing}>{char.name}</td>
        )
    })

    const charImages = teamChars.map((char) => {
        return (
            <td key={char.images.mainImage} title={char.weaknesses.text}><img src={char.images.mainImage} className="teamImages" alt=""/></td>
        )

    })

    const charAssists = assistArray.map(() => {
        return (
            <td>
                <select>
                    <option className="A">A</option>
                    <option className="B">B</option>
                    <option className="C">C</option>
                </select>
            </td>
        )
    })

    const charStrengths = teamChars.map((char) => {
        const filler = char.strengths.keywords.sort().map((word) => {
            return (
                    <ul className="details">+{word}</ul>
            )
        })
        return (
            <td>{filler}</td>
        )
    })

    const charWeaknesses = teamChars.map((char)=>{
        const filler = char.weaknesses.keywords.sort().map((word) => {
            return (
                    <ul className="details">-{word}</ul>

            )
        })
        return (
            <td>{filler}</td>
        )
    })

    const charRoles = teamChars.map((char) => {
            const prePos = ((char.positions.point[0]==1)?"Point":(char.positions.mid[0]==1?"Mid":"Anchor"))
            return (
                <td>{prePos}</td>
            )
})

    const removeButtons = teamChars.map((char) => {
        function handleRemove(e){
            setTeamChars(teamChars.filter((char)=> char.id != e.target.id))
        }
        return (
            <td><button onClick={handleRemove} id={char.id}>Remove</button></td>
        )
    })

    const teamStrengths = charStrengths.map((obj)=>{
        const filler = obj.props.children.map((obj2)=>{

            return <span className="details">{obj2.props.children}  </span>
        })
        return ( <div colSpan={3}>{filler}</div>)
    })

    const teamWeaknesses = charWeaknesses.map((obj)=>{
        const filler = obj.props.children.map((obj2)=>{
            return <span className="details">{obj2.props.children}  </span>
        })
        return ( <div colSpan={3}>{filler}</div>)
    })


    return (
        <div id="tableHolder">
        <table id="teamCharTable">
            <tbody>
                <tr className="teamCharContainer">
                    <td> </td>
                    <td>Point</td>
                    <td>Mid</td>
                    <td>Anchor</td>
                </tr>
                <tr className="teamCharContainer">
                    <td>Name</td>
                    {charNames}
                </tr>
                <tr className="teamCharContainer">
                    <td>Image</td>
                    {charImages}
                </tr>
                <tr className="teamCharContainer">
                    <td>Assist</td>
                    {charAssists}
                </tr>
                <tr className="teamCharContainer">
                    <td>Strengths</td>
                    {charStrengths}
                </tr>
                <tr className="teamCharContainer">
                    <td>Weaknesses</td>
                    {charWeaknesses}
                </tr>
                <tr className="teamCharContainer">
                    <td>Preferred Role</td>
                    {charRoles}
                </tr>
                <tr className="teamCharContainer">
                    <td>Team Strengths</td>
                    <td colSpan={3}>{teamStrengths}</td>
                </tr>
                <tr className="teamCharContainer">
                    <td>Team Weaknesses</td>
                    <td colspan={3}>{teamWeaknesses}</td>
                </tr>
                <tr className="buttonContainer">
                    <td>Remove</td>
                    {removeButtons}
                </tr>
            </tbody>
        </table>
        <br></br>
        </div>

    )
}

export default Team;
